import React from 'react';

const Space = ({ space, capture, index }) => {
	return (
		<div
			className="space"
			onClick={() => {
				console.log('jello');
				capture(index);
			}}
		>
			<h2>{space.value}</h2>
		</div>
	);
};

export default Space;
